import { createRouter, createWebHistory } from 'vue-router'

import Page2 from 'views/Page2.vue'

const routes = [
    {
        path: 'page2',
        name: "Page2",
        component: Page2
    }
]

const router = createWebHistory({
    history: createWebHistory(),
    routes
})

export default router
